(24, 25, 79, 'Audrey', 'BERTHEAS', 'audrey', '1981-07-11', 'Adepte des produits surgelés et de la cuisine toute prête il y a encore 3 ans, je participe à des ateliers de cuisine dans le cadre d''études marketing. Et là, c''est la révélation !! Ma passion, notamment pour la pâtisserie se développe de jour en jour, les livres de cuisines ont envahi mon appartement (la cuisine n''étant plus assez grande). Et tout mon entourage (famille, amis et collègues de bureau) est ravi de tester au quotidien mes nouvelles créations !!', 'Impossible de me décider entre le mille feuille à la provençale, le cheesecake citron/fraises, les lasagnes saumon/chèvre ou encore la tarte sablée fine aux pommes....', 'FY3f1bcb10', 3.25, '06 67 96 80 25', 1, 1, NULL),
(25, 26, 76, 'MELANIE', 'TACQUARD', 'melanie', '1980-05-30', 'Dans le médico social la semaine, dans ma cuisine le week end...', 'Risotto Terre/Mer et capucine de chorizo, Bouillon de moelle et petits légumes de printemps, panacotta ananas caramélisé...', 'FY549cc11b', 4, '06 17 23 81 08', 1, 1, NULL),
