(38, 43, 81, 'Florence', 'DESSAGNE', 'florence', '1974-12-22', 'Propriétaire d''un restaurant bar très réputé sur la place Lyonnaise, il y a quelques années. Suis revenue à mes premières amours : La communication mais spécialisée dans l''Art de Vivre. La patronne à l''Horloge mais pas derrière les fourneaux, cette fois je veux défier mes anciens chefs ;-) Le défi va être hardu mais je le relève. Go ! Même si j''ai plus l''habitude d''être au resto que dans ma cuisine.', 'Le chili con carne pour les amis', 'FY1535bde0', 4, '06 62 80 70 76', 1, 1, NULL),
(39, 44, 80, 'Fafa', 'Buleuse', 'fafa', NULL, 'Passionnée par l''Humain, j''ai évolué pendant plus de 10 ans en Ressources Humaines et Communication interne au sein de grands groupes; Communicante dans l''âme et aimant relever les défis, j''ai créé mon agence de communication "100% art de vivre" en 2015 grâce à une belle rencontre.\r\nEnfin, épicurienne depuis toujours, j''aime cuisiner pour régaler ma famille et mes amis.', 'La fondue savoyarde pour mes amis', 'FY3d0357b3', 4, '06/83/83/13/28', 1, 1, NULL),
