(96, 107, 130, 'Ryma', 'PROST-ROMAND', 'ryma', '1965-02-05', 'Voilà près d''un demi siècle que je goûte à tout, je suis gourmande et passionnée d''épices. Mes voyages se passent dans les cuisines des autres. J''aime y être invitée et partager la préparation des mets. Chaque cuistot est différent dans sa façon de s''organiser, de laisser libre court à son imagination ou d''appliquer des techniques. Mère de trois enfants et salariée à temps complet j''ai toujours tout préparé et  cuisiné au rythme des saisons. Les vacances sont synonymes de grande tablée, de cinq convives nous passons facilement à  quinze. Le point commun, c''est l''accueil et la simplicité. Durant l''été c''est cuisine du frigo, nous ne perdons jamais rien et recyclons tout. Nous cuisinons dans des lieux peu confortables et nous imaginons même des recettes de pain dans levain si le boulanger ne passe pas au village. J''aime les rencontres en cuisine , les épices qui réveillent, la crème qui caresse, le vin qui révèle,...', 'Boulettes de viande facon tajine en sauce tomates aromatisé au thym accompagné d''une purée de pommes de terre réhaussée d''olives concassées.', 'FY30e66e46', 0, '06 40 58 87 71', 0, 0, 'consultante en formation, j''essaye de courir et je cuisine'),
