(107, 118, NULL, 'Damien', 'VEAU', 'damien', '1984-08-08', 'Pendant mes études de chimiste, nous avions une blague récurrente pour expliquer notre art aux non-initiés : "C''est comme de la cuisine, mais on n''a pas le droit de lécher la cuiller." Il est donc naturel que le chimiste s''épanouisse également en cuisine pour laisser s''épanouir son meilleur péché : la gourmandise.\r\nLa chimie a également pris possession de mes loisirs à travers le brassage de bière en amateur. Élaboration de nouvelles recettes, extraction de sucres et réaction de Maillard puis fermentation et maturation passionnent ma partie scientifique tandis que les odeurs du malt chaud et du houblon ainsi que la dégustation mettent en émoi le gourmand.', 'Sauté de filet mignon sauce miso et son riz coco', 'FYe76a0321', NULL, '06 85 32 91 48', 0, 0, 'pas bavard avant le petit dej'),
