(176, 209, 288, 'Elodie', 'Sanches Rafaralahy', 'elodie', NULL, 'Je fonds à l''idée de partager ce plaisir de la cuisine avec des professionnels. Je n''en suis pas une moi-même, mais ne vous inquiétez pas, je ferai de mon mieux! Je pense tout de même avoir du bol de pouvoir enfin voir comment se passe un service en cuisine. Je ne dirai pas que j''en rêvais mais presque :)\r\nNous aurons tous du pain sur la planche ce soir-là pour le plus grand bonheur de vos petits bidons!', 'Ballottines de poulet au chorizo et mozzarella', 'FY82e89bc9', NULL, '06 10 72 93 94', 0, 0, 'Une maman débordée :)'),
(177, 210, 245, 'Lolotte', 'Gn', 'lolotte', NULL, NULL, NULL, 'FY81d1d112', NULL, NULL, 0, 0, NULL),
