(180, 213, 260, 'Nicolas', 'Antonini', 'nicolas', NULL, 'Pas trop de salades ou alors rendre à Caesar la sienne ! \r\nIci ça sent le sud, du sud-ouest à la Sicile des petits plats simplement bons à partager  :) \r\nCuisinier très amateur et gastronome en culotte longue !', 'L''Osso Bucco ou les Chaussons du Cardinal :)', 'FY66a5f743', 3.3333333333333335, '06 66 13 13 82', 1, 1, 'Enthousiastique confirmé et positiviste pratiquant'),
