(188, 221, 274, 'Clélia', 'Ailélc', 'clelia', NULL, 'Manger, manger et manger ! Voila mon let'' motiv.\r\nEn grande curieuse, j''ai toujours envie de tester de nouvelles saveurs, rien ne m''arrête. Ne le dites à personne mais  j''ai même déjà essayé les insectes (GLOUPS), histoire de ne pas mourir idiote. \r\nDans un style un peu plus gourmand, je suis dingue de la cuisine au thé matcha. Plus globalement, les influences asiatiques ont le don de me faire chavirer. Je ne peux pas résister à un panier fumant de dim sum. Et mon voyage récent en Chine n''a pas arrangé les choses. ;)\r\nSerial testeuse de restaurants, vous retrouverez mes coups de coeur sur mon blog Révélations gourmandes (garanti sans insecte..ou presque ;) ).', 'Tellement curieuse que je refais rarement un plat. L''appel de la nouveauté est trop fort !', 'FYcd1955b7', 3.9375, '06 35 58 08 11', 1, 1, 'Dans la communication digitale'),
(189, 222, 276, 'Emilie', 'Van Dommele', 'emilie-1', NULL, 'Vorace, têtue, gourmande, passionnée. Mon intérêt pour la cuisine et tout ce qui se mange remonte à des souvenirs très lointains, des vacances en Dordogne, à Rocamadour en passant par les caves de Beaunes. Ajouté à cela pas mal de temps passé au Canada et aux USA. A chaque fois nos valises étaient remplies de mets divins et aussi de bouquins de cuisine. Chauvine j''avoue un faible pour la cuisine française et aussi pour les gros desserts américains. Pas sectaire pour un sous , j''aime aussi bien les gastronomiques que la street food. Le plus important c''est de se régaler. Sur cinnamonandcake, tu trouveras plein de recettes gourmandes et d''endroits sympas pour becqueter.', 'Pas de signature, mon côté vorace me pousse à toujours tester des nouveaux trucs.', 'FY68bc8a03', 3.75, '06 66 04 98 62', 1, 1, 'Mangeuse confirmée'),
(190, 223, 278, 'Laetitia', 'Bertrand', 'laetitia-1', NULL, NULL, NULL, 'FY03c248be', NULL, NULL, 0, 0, NULL),
