(254, 314, 378, 'Maud', 'Boyer', 'maud', '1995-03-27', 'Federico Fellini ha detto "la vita è una combinazione di magia et pasta".\r\n\r\nAucune citation ne saurait coller davantage à mon état d''esprit !\r\n\r\nD''origine italienne, j''ai grandi dans un environnement qui m''a conduite à apprécier l''art de la table dès ma plus tendre enfance.\r\n\r\nVéritable épicurienne, j''aime découvrir de nouvelles saveurs et élaborer des recettes à base de produits sains et savoureux. La cuisine représente pour moi un moment de partage unique au cours duquel je tente au mieux de ravir mes convives. Ma plus grande satisfaction réside dans leurs sourires après un bon repas !\r\n\r\nDe plus, je crois profondément que la bonne gastronomie n''a besoin d''aucun artifice c''est pourquoi j''affectionne les recettes simples qui conservent des goûts authentiques et (très) gourmands !', 'Risotto ai funghi', 'FY32dd6611', NULL, '06 63 03 78 61', 0, 0, 'Etudiante en droit (et grande gourmande)'),
