(275, 336, 586, 'Nicolas', 'Montagard', 'nicolas-2', '1984-08-28', '1er Job d''adolescent : aide boulanger\r\n2ème job d''ado : plongeur puis commis entrées / desserts\r\n1er Job étudiant : production / Boulangerie PAUL\r\n2ème Job étudiant : production / McDONALD\r\n\r\nBon ! En vrai cette passion pour la cuisine me vient, non pas de mes petites expériences, plutôt de mon cher PAPA qui à toujours préparé nos plats, de mon intérêt pour les bons produits, les saveurs raffinées, et la santé par l''alimentation.\r\n\r\nJ''ai donc, à l''image du Papa, commencé à cuisiner tous mes repas dès que j''ai commencé à vivre seul. En 10 ans j''ai appris seul, avec mon imagination, avec des souvenirs, avec des cours réel ou sur le internet, ou à tâtonnant pour reproduire des recette que j''ai goûté dans des restaurants.', 'Roulé de volaille forestier', 'FY57049e36', NULL, NULL, 0, 0, 'Consultant-Formateur en Informatique'),
(276, 337, 423, 'Odile', 'Beneteau', 'odile', NULL, NULL, NULL, 'FY153456d3', NULL, NULL, 0, 0, NULL),
(277, 338, NULL, 'Aurelienj', 'Bal', 'aurelienj', '1986-10-28', NULL, NULL, 'FY54556a0f', NULL, NULL, 0, 0, NULL),
(278, 339, 430, 'Mélodie', 'Masset', 'melodie', NULL, '« CON ENERGIA !»\r\n\r\nNombreux(ses) sont les passionné(e)s de cuisine qui ont d''abord cultivé ce plaisir en famille avant que cela devienne une histoire personnelle. Mon histoire en fait partie! Avec patience, poigne, et vitalité, je vous livre son secret...\r\n\r\nTout a commencé il y a fort longtemps à San Giuseppe dans la province de Frosinone. C''est un petit village situé au sud de Rome. Il est réputé pour ses relents culinaires qui suscitent l''appétit des gourmands du monde entier. Nous citerons le fameux fromage Pecorino spécialité de là-bas...\r\n\r\nDans une maison tout en pierre vivait Mamie Concetta. Avec toute la famille et les voisins le quotidien se concentrait autour du travail des terres agricoles. Les femmes concoctaient ensemble une cuisine familiale riche et généreuse dotée d’ingrédients fraîchement cueillis. Imaginez ce four à pierre qui offre une cuisson sans pareil! Bercée par les phrases chantantes en patois Italien de « La nonna » puis de « la mama », enfant, je m''endormais au cœur des milles et uns parfums fruités, salés et sucrés. Rêves de figuiers et de citronnier... Le lendemain les repas en famille frémissaient d''amour autant que les plats tout juste sortis du four. Entre deux plats, confidences chuchotées dans la cuisine de la nonna, "assaggiarlo y cosi" (goûtes-moi ça)\r\n\r\nAujourd''hui, à Lyon, la cuisine de Mamie Concetta s''est expatriée et la famille aussi. J''ai perpétué ses recettes en les revisitant pour à son tour réunir les Lyonnais autour de surprises appétissantes. Après s''être équipée d''une cuisine aussi spacieuse que chaleureuse, J''ai doté ses surfaces aussi blanches que la mozzarella de casseroles qui sonnent comme le "Bella Ciao" de Mamie Concetta!\r\nMama mia! Attablez-vous, canalisez vos cinq sens en ébullition!\r\nAccompagnée par mamie Concetta et la mamma, après un petit tour au marché de la Croix Rousse Mélodie aux fourneaux s''apprête à vous servir votre repas...\r\n\r\nPartagez un voyage à travers une multitude de souvenirs que je vais vous concocter. Convivialité et fous rires sont au rendez-vous de mes repas, Je souhaite qu''ils fassent aussi partie des vôtres.\r\n\r\nVoilà quelques cuillerées qui vous laissent entendre le synopsis, l''avant propos, l''édito de ma cuisine et qui vous donneront probablement envie d''en reprendre un peu!\r\n\r\nCiao', 'Le tiramisu revisité', 'FY45aba57d', NULL, '06 33 24 98 71', 0, 0, 'Hyppie chic gourmande à 200 à l''heure'),
