(299, 373, 628, 'Virginie', 'BOUVARD', 'virginie-1', '1975-02-07', 'Que dire d’autre si ce n’est que je suis une fille, que j''ai travaillé aux achats dans le domaine de la décoration. J''aime osciller entre donuts à la framboise, Stephen King, Tim Burton, bonbons qui piquent, Nan Goldin, Bad Taste et Toy Story… \r\nD’aussi loin que je m’en souvienne ce surnom de Cloporte a toujours été le mien. Il me résume finalement assez bien et j’assume totalement cet aspect de ma personnalité. Le Cloporte est une espèce de crustacé présentant une coquille grise assez dure, oui, c’est ce petit isopode que vous trouvez sous les cailloux qui se recroqueville quand on le touche. Après un certain temps et beaucoup de calme, le Cloporte s’ouvre à nouveau et peut même parfois grimper dans le creux de votre main.', 'Tout ce qui contient du sucre et des fruits de la passion', 'FY876230cd', NULL, '0681711286', 0, 0, 'CM, Photographe et couteau suisse freelance'),
