(306, 380, 489, 'Marion', 'Beaudouin', 'marion-2', '1992-04-17', 'Après un tour de l''espace en 80 jours, j''ai découvert des saveurs encore inconnues et je souhaite vous les faire découvrir lors de la soirée Food & You du 18 mai !', 'Farcis-moi ça !\r\n\r\nUne entrée composée d''une tomate froide farcie à la niçoise, et d''une fleur de courgette farcie au fromage de chèvre frais !', 'FYfdac7f1b', 3.857, '07 86 95 72 56', 1, 1, 'Animatrice radio de l''espace'),
