(309, 383, 493, 'Chaimae', 'Chraibi', 'chaimae', NULL, 'Hello, je m''appelle Chaïmâe, j''ai 25 ans et des rêves plein la tête ! Des rêves de food, bien évidemment !\r\nD''origine marocaine, j''adore les mélange de saveurs bien dosés, goûter des aliments dont je n''ai jamais entendu parler et passer mes week end derrière les fourneaux pour faire plaisir à tout ceux que j''aime ! \r\nEt je suis prête à essayer de faire ça avec encore plus de gens =D', 'Tajine de poulet à la manière de ma grand-mère', 'FY14b185d1', NULL, '06 51 86 69 77', 0, 0, 'Ingénieur informatique le jour, blogueuse et photographe gourmande la nuit'),
