(328, 403, 518, 'Emi', 'Mjo', 'emi', NULL, 'Moi, Emi, je revisite les recettes pour diminuer de moitié les calories. \r\nOui, oui, je vous le garantie, on peut faire de la très bonne gastronomie tout en restant healthy. On fait le pari ?', 'Curry de crevettes', 'FYa7d9fc69', 3.5714285714285716, '0630652753', 1, 1, 'Sportive et gourmande compulsive'),
