(335, 410, 555, 'Clémence', 'Karsenty', 'clemence', '1990-01-27', 'Sur les réseaux sociaux le jour pour le travail, je passe en cuisine soir et weekend pour la famille et les amis. J''aime toutes les cuisines et je n''hésite pas à pimper la mienne d''influences du monde entier !', 'Un curry de poulet rouge ou vert', 'FY50ad679f', NULL, 'ààààààà', 0, 0, 'Loin des fourneaux, derrière un bureau !'),
