(342, 417, 560, 'Manon', 'Zt', 'manon-1', NULL, 'Passionnée de cuisine, je suis toujours à la recherche de nouvelles saveurs et associations. Certes il y a parfois des loupés... mais c''est meilleur après quelques tentatives !\r\n\r\nJe suis yelpeuse élite à Lyon,  je teste donc de nombreux restaurants, salons de thé...', 'Je n''ai pas de plats signatures particuliers, j''aime autant cuisiner salé que sucré. \r\n\r\nSalé : Risotto\r\nSucré : Layer cake', 'FY0b51da1e', NULL, '0662944546', 0, 0, 'Dynamique'),
(343, 418, 588, 'Sophia', 'Yelp', 'sophia', '1990-01-01', 'J’ai une double culture asiatique/ français, et j’adore voyager. Je considère la cuisine la meilleur façon pour connaitre le monde. C''est pour ça J’aime réaliser ou revisiter les plats classiques français, les incontournable plats asiatiqe, ou les inspirés de mes voyages !\r\n\r\nJ’aime les produits frais, et des épices, des épices du monde entier.', 'tonkatsu, bibimbap, ou tiramisu au matcha', 'FY63fc5246', NULL, '0666506700', 0, 0, 'Yelpeuse'),
(344, 419, 563, 'Maria', 'Paez', 'maria-5', NULL, NULL, NULL, 'FYf97ca821', NULL, NULL, 0, 0, NULL),
(345, 420, 565, 'Maria', 'Paz', 'maria-6', '2016-05-12', NULL, NULL, 'FY41ce1947', NULL, NULL, 0, 0, NULL),
(346, 421, 572, 'Nicolas', 'Carrier', 'nicolas-3', '1988-08-10', 'Passé par les cuisines d''un restaurant étant étudiant, j''ai pourtant refusé cette voix avec aujourd''hui un grand désir d''y revenir ! Bien plus qu''une passion pour moi, je suis celui que l''on colle aux fourneaux durant les soirée (et que ça soit pour le shaker ou les casseroles...).\r\n\r\nUn grand amour de la cuisine qui me pousse a toutes les curiosité et parfois même a manger des trucs particulièrement affreux. Mais qui sait ou les bonnes surprises se cachent ?!\r\n\r\nPeut être que le temps d''un soir je peux vous faire partager mon univers ? Une cuisine avec des produits simples et de saisons. Toujours très assaisonné, inspiré de la street food pas toujours clean des échoppes du bord de route... Ce soir on va voyager !', 'Brochettes de viandes marinées, sauces d''inspirations asiatiques,\r\nServies dans des galettes couvertes d''aromates.', 'FY9434a2ef', NULL, 'à§é((àç(à', 0, 0, 'Un bureaucrate qui a énormément d''énergie à revendre.'),
