(381, 457, 614, 'Justine', 'DEGRANDI', 'justine', '1987-10-24', 'Dans ma famille, on a toujours partagé la passion du « bien manger », j’ai donc toujours baigner dans un environnement gourmand ! Mes amis pourraient vous le dire, au quotidien, je ne parle que de cuisine …  j’aime beaucoup recevoir et surprendre mes convives alors je suis toujours à la recherche de nouvelles recettes ! … Je suis également Rédactrice FOOD pour le blog "Talons Aiguilles et Running Shoes" !\r\nD''origine italienne et ayant vécu là-bas quelques mois, venir cuisiner avec Lello sera un vrai bonheur :)', 'Pasta al limone', 'FYd7e1288d', NULL, '0786100236', 0, 0, 'Passionnée de cuisine'),
