INSERT INTO `recipe` (`id`, `member_id`, `photo_id`, `name`, `type`, `public_description`, `private_description`) VALUES
(1, 24, 47, 'Quand le Tiramisu rencontre la Belle Hélène...', '2dessert', 'Revisite du tiramisu avec une association poire/chocolat et un biscuit sablé breton', 'volonté de conserver les éléments de vase du tiramisu : une crème au mascarpone, un biscuit et une sauce mais en associant des saveurs différentes du traditionnel café.\r\nLa crème au mascarpone est vanillée et se mélange à une brunoise de poires (légèrement caramélisées à la poêle). Un coulis chocolat vient remplacer le café et le biscuit est un sablé breton dont la texture devient fondante avec le mélange.'),
(2, 28, 50, 'Salade chèvre chaud et miel', '0entry', 'Salade de chèvre chaud', 'Salade, chèvre, toast, miel'),
(4, 22, 56, 'sushi', '0entry', 'saumon riz', 'sushi saumon'),
(5, 22, 57, 'maki', '0entry', 'makis', 'maki'),
(6, 27, 58, 'Gravelax de boeuf et légumes croquants', '0entry', 'filet de boeuf mi cuit au sel et aromate\r\nquelques légumes croquants, purée de céleri \r\nchips de parmesan\r\nvinaigrette à la mangue pour relevé tout ça', 'Ingrédients\r\n\r\n500 g de filet de Bœuf\r\n1 gousse d’ail\r\n50 g de sucre\r\n100 g de gros sel\r\n5 g de gingembre \r\n\r\n1 carotte violette\r\n1 chou romanesco\r\n1botte d’asperge\r\n1 oignon rouge\r\n10g de beurre\r\n10g de sucre\r\n\r\n1 Mangue\r\n1 citron vert\r\n1 cuillère à soupe de vinaigre de cidre\r\n2 cuillères à soupe d’huile d’olive\r\n\r\n100 g de parmesan\r\n\r\nGravlax de bœuf\r\n\r\nPelez l’ail et le gingembre et l’écrasez.\r\nDans une boite hermétique, mettez le gros sel, le sucre  le gingembre, l’ail, le bœuf.\r\nLaissez 24 au réfrigérateur en retournant la boite de temps en temps.\r\n\r\nLes Légumes\r\nNettoyez les légumes.\r\nRécupérez quelques inflorescences de chou romanesco.\r\nTaillez des lamelles de carotte.\r\nFaites fondre le beurre dans une casserole, mettez le choux,mouillez à hauteur les légumes, ajoutez une cuillère à café de sucre, mettez un disque de papier sulfurisé et faites cuire 10 minutes.\r\nFaire de même avec les carottes dans une autre casserole.\r\nTaillez de fines lamelles d’oignon rouge.\r\n\r\nVinaigrette à la mangue.\r\n\r\nDécortiquez 1 mangue.\r\nPassez la mangue décortiquée au mixeur, avec le jus d’1/2 citron vert et 1 cuillère à soupe de vinaigre de cidre.\r\nMontez ensuite cette vinaigrette en incorporant 2 cuillère à soupe d’huile d’olive, sans cesser de mixer.\r\n\r\n\r\nTuile de Parmesan\r\n\r\nFaites chauffer le four à 180°C\r\nEtalez une mince couche de parmesan sur une feuille de papier cuisson\r\nMettre au four 7mn en surveillant la coloration.\r\nTaillez vos chips à l’emporte pièce\r\n\r\nDressage\r\n\r\nPlacez la vinaigrette\r\nTaillez de fine tranche de Gravlax et les enroulez\r\nSur la vinaigrette, intercalez  les différents éléments.'),
(7, 27, 59, 'Gravelax de boeuf et légumes croquants', '0entry', 'Filet de boeuf mi-cuit au sel et aromates\r\nLégumes croquants, purée de celeri\r\nchips de parmesan\r\nvinaigrette à la mangue pour relevée tout ça', 'Ingrédients\r\n\r\n500 g de filet de Bœuf\r\n1 gousse d’ail\r\n50 g de sucre\r\n100 g de gros sel\r\n5 g de gingembre \r\n\r\n1 carotte violette\r\n1 chou romanesco\r\n1botte d’asperge\r\n1 oignon rouge\r\n10g de beurre\r\n10g de sucre\r\n\r\n1 Mangue\r\n1 citron vert\r\n1 cuillère à soupe de vinaigre de cidre\r\n2 cuillères à soupe d’huile d’olive\r\n\r\n100 g de parmesan\r\n\r\nGravlax de bœuf\r\n\r\nPelez l’ail et le gingembre et l’écrasez.\r\nDans une boite hermétique, mettez le gros sel, le sucre  le gingembre, l’ail, le bœuf.\r\nLaissez 24 au réfrigérateur en retournant la boite de temps en temps.\r\n\r\nLes Légumes\r\nNettoyez les légumes.\r\nRécupérez quelques inflorescences de chou romanesco.\r\nTaillez des lamelles de carotte.\r\nFaites fondre le beurre dans une casserole, mettez le choux, mouillez à hauteur les légumes, ajoutez une cuillère à café de sucre, mettez un disque de papier sulfurisé et faites cuire 10 minutes.\r\nFaire de même avec les carottes dans une autre casserole.\r\nTaillez de fines lamelles d’oignon rouge.\r\n\r\nVinaigrette à la mangue.\r\n\r\nDécortiquez 1 mangue.\r\nPassez la mangue décortiquée au mixeur, avec le jus d’1/2 citron vert et 1 cuillère à soupe de vinaigre de cidre.\r\nMontez ensuite cette vinaigrette en incorporant 2 cuillère à soupe d’huile d’olive, sans cesser de mixer.\r\n\r\n\r\nTuile de Parmesan\r\n\r\nFaites chauffer le four à 180°C\r\nEtalez une mince couche de parmesan sur une feuille de papier cuisson\r\nMettre au four 7mn en surveillant la coloration.\r\nTaillez vos chips à l’emporte pièce\r\n\r\nDressage\r\n\r\nPlacez la vinaigrette\r\nTaillez de fine tranche de Gravlax et les enroulez\r\nSur la vinaigrette, intercalez  les différents éléments.\r\nParsemer quelques noisettes toréfiées'),
(8, 24, 77, 'Quand le Tiramisu rencontre la Belle Hélène', '2dessert', 'Tiramisu revisité avec une association poire/chocolat et un sablé breton', 'Volonté de revisiter le tiramisu en gardant les éléments (biscuit, crème, sauce) mais en changeant les saveurs : je conserve la crème mascarpone (vanillée) que j''associe à une brunoise de poires (légèrement caramélisées à la poêle) sur un sablé breton (qui devient fondant avec la crème) et un coulis de chocolat (à la place du café).'),
(9, 24, 62, 'Quand le Tiramisu rencontre la Belle Hélène', '2dessert', 'Tiramisu revisité avec une association poire/chocolat et un sablé breton', 'Volonté de revisiter le tiramisu en gardant les éléments (biscuit, crème, sauce) mais en changeant les saveurs : je conserve la crème mascarpone (vanillée) que j''associe à une brunoise de poires (légèrement caramélisées à la poêle) sur un sablé breton (qui devient fondant avec la crème) et un coulis de chocolat (à la place du café).'),
(10, 14, 63, 'Cuisse de pintade au combava en cromesquis, velouté de polenta à la vanille et billes croustillantes épicées', '0entry', 'Petit beignet de pintade au combava sur un lit de polenta très crémeuse à la vanille. Billes vertes croustillantes fourrées et épicées.', 'Cuisse de pintade désossées et préparées en façon "farce mousseline" pour en faire des cromesquis, présentés sur l''os de pintade (comme si c''était la cuisse elle-même).\r\nPolenta en velouté agrémentée de vanille.\r\nBilles croustillantes de persillade, remplie d''une crème de tomate vinaigrée et épicée.'),
