(14, 25, 75, 'Risotto Ter Mer', '1main', 'Le poisson repose sur un lit de risotto aromatisé à la bouillabaisse, avec ses petites tuiles croquantes chorizo et parmesan', 'Risotto de St Pierre ou de Barbu (selon arrivage)\r\nLe bouillon du Risotto est fait avec un fond de poisson (carcasse du poisson, tomates, concentré de tomate, oignons, ail, échalotes, vin blanc,sel et poivre)\r\nInfusion de feuilles de cerfeuil dans le bouillon avant son utilisation.\r\nAu dernier moment, j''ajoute crème fraîche, parmesan et quelques anneaux de calamars.\r\nUne petite tuile parmesan/cerfeuil\r\nUne chips de chorizo (ce n''est pas très italien...)\r\nUne sauce, crème chorizo (possible de faire en espuma)'),
(15, 38, 83, 'Pavlova façon pina colada', '2dessert', 'Pavolva (meringue - chantilly) à l''ananas et noix de coco', 'Pavolva (meringue - chantilly) à l''ananas et noix de coco'),
(16, 23, 538, 'Tartare Di Cabras', '0entry', 'Tartare Di Cabras', 'Tartare di Cabras\r\n\r\nQuantités pour pour 6 personnes / galette de poids chiches :\r\n100g de farine de poids chiche\r\n3g de sel\r\n1g Poivre\r\n200g d''eau\r\n10g d''huile d''olive\r\n--> Tout mettre dans un bol dans cet ordre, puis frigo (1h au frigo)\r\n\r\n(Verser le contenu à plat très fin, four 205°)\r\n--> Laisser refroidir 10/15min\r\n--> Découper à l''emporte pièce\r\n\r\n1 carotte jaune + 1 carotte violet : 1/4 carotte de chaque par personne\r\nPiment d''espelette\r\nSel\r\nPoivre\r\nHuile d''olive\r\n--> Emincer les carottes et ajouter l''assaisonnement\r\n--> AJouter le persil pour garder la couleur (anti-oxydant)\r\n\r\nPersil\r\n--> Hacher le persil à la main très très fin\r\n\r\n1/4 de gousse d''ail / personne\r\n--> Hacher et mélanger avec le persil\r\n\r\n80g de Viande par personne\r\n--> Ajouter le mélanger persil et ail + sel + poivre\r\n--> Ajouter une grande cuillère de moutarde pour 250g de viande\r\n--> Si tout absorbé, alors ajouter de l''huile d''olive\r\n\r\nFaire des quenelles de Ricotta\r\n\r\nDresser le tout avec un emporte pièce !'),
(17, 41, 86, 'Contre filet rôti entier', '1main', 'Contre filet rôti entier accompagné de ses petits légumes', 'crouter la viande , reposer 5 mn puis faire une ballotine. Au four à 90° jusqu''à 47° à coeur . Pour dresser, légèrement napper avec de la crème de sésame puis poser les morceaux de viande en tronçons. Ajouter la purée à la ciboulette + légumes.'),
