INSERT INTO `restaurant` (`id`, `owner_id`, `address_city_id`, `gallery_id`, `cuisine_id`, `name`, `description`, `opening_date`, `address_street`, `address_postal_code`, `status`, `social_info_site`, `social_info_trip_advisor`, `social_info_facebook`, `contact_info_phone`, `contact_info_mobile_phone`, `contact_info_email`) VALUES
(2, 2, 1, 2, 1, '136 avenue', 'Le 136 avenue est un restaurant de cuisine française, à base de produits frais de saison. Stéphanie et Fabrice vous accueillent dans un décor moderne et chaleureux, pour un moment gastronomique convivial !', '2014-06-01', '136 avenue Félix Faure', '69003', 'validated', 'https://www.facebook.com/136avenue.fr', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d5577559-Reviews-Cafe_Restaurant_136_Avenue-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/136avenue.fr', '04 78 54 75 35', '04 78 54 75 35', 'contact@136avenue.com'),
(3, 4, 1, 3, 2, 'Chez Augusto', 'Situé sur la presqu’île, en plein centre de Lyon, Chez Augusto fait partie de ces adresses qui cultivent fond et forme : cadre épuré et soigné et assiette pour gourmets. La spécialité de la maison ? L’Italie, dans ce qu’elle a de plus gastronomique.', '2012-06-01', '6 rue Neuve', '69002', 'validated', 'http://restaurant.michelin.fr/restaurant/france/69002-lyon/augusto/3r77k7v', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d3482611-Reviews-Chez_Augusto-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/Augusto.restaurant.Lyon', '04 72 19 44 29', '04 72 19 44 29', 'augusto_italien@yahoo.fr'),
(4, 6, 1, 4, 1, 'Le Moment', 'Niché au milieu d’arbustes, à l’écart de la rue on redécouvre le bonheur d’être au calme. Véritable bulle de sérénité, loin de la ville et de son brouhaha, « le Moment » vous promet des instants délicieux.\r\nLe Lyonnais Alexandre Gaillot Drevon s’est mis à la cuisine, sans doute influencé par son père, cuisinier de formation, qui a tenu des restaurants en Isère. C’est ainsi qu’il prendra le chemin du lycée Rabelais, l’occasion pour lui d’effectuer son apprentissage à Lyon auprès d’Alex Tournadre. \r\nIl propose au Moment une cuisine créative, de saison, uniquement à base de produits frais.', '2013-01-01', '33 rue de Saint Cyr', '69009', 'validated', 'http://www.restaurantlemoment.fr', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d1332187-Reviews-Le_Moment-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/Le-Moment-1458261457747111/?fref=ts', '04 78 83 23 71', '06 09 51 88 62', 'alex.gourmet@hotmail.fr'),
(5, 11, 1, 5, 1, 'Le Plato', 'Le chef et propriétaire Frédéric Therriaud vous accueille au Plato... pour un voyage garanti aux pays des saveurs. Une cuisine fraîche, généreuse, belle et savoureuse, de quoi conquérir vos papilles. Le Chef Therriaud fait son tour de marché pour nous concocter de jolis mets. Le chef entend continuer l’histoire de la bonne chère de son prédécesseur, mais ceci ne lui empêche pas d''ajouter sa touche personnelle. Pour lui il n''y pas de secret il faut de la passion et du savoir faire ! Et comment ne pas l''avoir acquis lorsque l''on a travaillé  pour les plus grandes maisons ( Nicolas Le Bec, Christian Tetedoie, Le Gourmet de Sèze, la Mère Vittet…) \r\nEn Bref, au Plato, vous ferrez de jolies rencontres, des belles découvertes gustatives et passerez un moment convivial dans un décor chaleureux...', '2012-01-01', '1 rue Villeneuve', '69004', 'validated', 'http://www.restaurant-leplato.fr', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d1329332-Reviews-Plato-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/LePlato.lyon', '04 72 00 01 30', '04 72 00 01 30', 'contact@restaurant-leplato.fr'),
(6, 12, 1, 6, 1, 'Les Saveurs du Bistrot', 'Grâce à la parfaite complicité, la même passion,\r\nla même vision du métier entre Damien Combe (en salle) et Eric Hubert (en cuisine)\r\nqui se sont rencontrés au restaurant "Mon bistrot à Moi".\r\nNotre restaurant est à mi-chemin entre la cuisine bistrot et la gastronomie.\r\nLe midi et le soir notre carte des menus propose pas moins de cinq entrées, cinq plats\r\ndont un poisson, trois fromages et plusieurs desserts.\r\nLe Chef, Eric Hubert accommode le choix des menus en fonction des arrivages.\r\nLa carte est variée et se dresse en fonction de la saison.', '2015-01-01', '10 rue Professeur Weil', '69006', 'validated', 'http://www.saveursdubistrot.com', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d8478076-Reviews-Les_Saveurs_Du_Bistrot-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/Les-Saveurs-Du-Bistrot-1618790475062513/', '04 37 24 14 25', '04 37 24 14 25', 'lessaveursdubistrot@gmail.com'),
(7, 16, 1, 7, 1, 'Arsenic', 'Arsenic : un mot aussi fort que notre passion pour la cuisine\r\nParce que nous avons la volonté de secouer avec énergie la cuisine traditionnelle pour lui donner un sens nouveau. \r\nAinsi est né L’Art-scénique ou « La scène des nouveaux chefs ». Ce lieu est un endroit unique où de jeunes chefs vont pouvoir donner libre cours à leur créativité et vous faire découvrir leur vision de la cuisine, épurée, décalée et toute en fraîcheur.\r\nArsenic incarne l''évolution de Chefs, issus de la nouvelle génération et passés par le restaurant étoilé Christian TETEDOIE.', '2012-01-01', '132 rue Pierre Corneille', '69003', 'validated', 'http://www.arsenicrestaurant.com', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d4995531-Reviews-Arsenic-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/arsenicrestaurantlyon', '09 62 39 85 55', '09 62 39 85 55', 'contact@arsenicrestaurant.com'),
(8, 8, 1, 8, 1, 'Le Basilik', 'Blotti entre la Basilique de Fourvière et le théatre antique romain, sur le site prestigieux de l''Antiquaille, le Basilik vous ouvre ses portes et sa cuisine.\r\nUn concept moderne et barroque à la fois, aux couleurs chaudes et intimes...\r\nUne salle de restaurant moderne, une cuisine ouverte et vitrée, un bar accueuillant, le tout relié par une coursive voutée : un site magique !', '2015-09-01', '63 montée du chemin neuf', '69005', 'validated', 'http://www.lebasilik.fr', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d3682199-Reviews-Le_BasiliK-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/LeBasilik', '04 74 26 95 73', '04 74 26 95 73', 'sgonnet69@gmail.com'),
(9, 17, 3, 9, 1, 'Histoire sans faim', 'Situé sur une des plus belles places de Rochetaillée sur Saône, notre restaurant vous accueille du mercredi au dimanche soir inclus. Aux beaux jours, venez profiter de notre terrasse et déguster une cuisine inventive et toujours renouvelée.', '2015-07-01', 'place Claudius Peytel', '69270', 'validated', 'http://www.histoiresansfaim.fr', 'https://www.tripadvisor.fr/ShowUserReviews-g1237620-d8305665-r292715341-Histoire_sans_faim-Montauroux_Var_Provence.html', 'https://www.facebook.com/toutlemondeatable/posts/413274228860766', '04 78 35 42 38', '04 78 35 42 38', 'histoiresansfaim@hotmail.com'),
(10, 18, 1, 10, 1, 'La table d''Eugène', 'A la table d''Eugène règne une atmosphère chaleureuse, nous sommes accueillis par une charmante serveuse aussi souriante que dynamique , toujours le petit mot pour rire. Les plats digne d''un trois étoiles, belle présentation, un mélange de saveurs, des produits frais. Les desserts maison sont divins, je vous recommande la tarte aux citrons meringuées au combava, ce petit goût acide exquis. ambiance chaleureuse, cuisine artistique, une adresse rue royale Lyon 1° à retenir !', '2012-01-01', '18 rue Royale', '69001', 'validated', 'http://www.latabledeugene69.com', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d2458429-Reviews-La_table_d_Eugene-Lyon_Rhone_Rhone_Alpes.html', NULL, '04 78 72 50 16', '04 78 72 50 16', 'restaurant@latabledeugene69.com'),
(11, 19, 1, 11, 1, 'La Brunoise', 'C''est en plein centre de Villeurbanne que Luc et Grégory conjuguent leurs talents et leur énergie. Une parenthèse gourmande pleine de charme et de sensibilité…\r\nLuc Vinot et Gégory Biechel sont amis de longues dates, ensemble au lycée hôtelier à Thonon les bains c''est tout naturellement qu''ils ont ouvert ensemble ''La Brunoise''. Ils sont donc deux cuisiniers associés, c''est le plus du restaurant avoir un chef en salle : Grégory connaissait déjà le service c''est avec plaisir qu''il explique à ses convives les différents plats.\r\n\r\nLa cuisine pour es deux experts c''est avant tout un bon produit… La gastronomie c''est savoir le transformer puis le sublimer…', '2012-01-01', '4 rue Alexandre Boutin', '69100 VILLEURBANNE', 'validated', 'http://labrunoise.fr/', 'https://www.tripadvisor.fr/Restaurant_Review-g207360-d1327930-Reviews-La_Brunoise_4-Villeurbanne_Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/La-Brunoise-49172533020/', '04 78 52 07 77', '04 78 52 07 77', 'labrunoise@gmail.com'),
(14, 109, 1, 16, 2, 'Lello', '« la vita è troppo corta per mangiare male… »\r\n\r\nUn restaurant italien à l’ambiance chaleureuse, où l’équipe vous propose chaque jour des produits frais, selon l’arrivage et l’humeur du chef.\r\n\r\nDepuis juin 2014, Lello est reconnu par la Chambre de Commerce et d’Industrie italienne de Lyon, et le gouvernement italien, comme une table 100% « cucina italiana » sous le label « Ospitalità italiana ».', '2013-01-01', '231 rue Paul Bert', '69003', 'validated', 'http://www.lello.fr', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d4130967-Reviews-Lello-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/LelloResto', '06 06 95 19 80', '06 06 95 19 80', 'contact@lello.fr'),
(15, 110, 1, 17, 1, 'Le Bistrot d''Arno', 'Arnaud Marichy sait de quoi il parle : son parcours, en particulier dans le bouchon lyonnais, lui a apporté une belle maîtrise des sauces et des cuissons. Sa carte de saison reflète son attachement au beau produit.\r\n\r\nAu Bistrot d’Arno, on se sent vite comme chez un ami (qui aurait des mains en or). Le décor est simple, logique, mais de bon goût. On n’est pas loin du bonheur…', '2013-01-01', '3 rue Bugeaud', '69006', 'validated', 'https://www.facebook.com/Le-Bistrot-dArno-239043989636196#_=_', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d7295374-Reviews-Le_Bistrot_d_Arno-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/Le-Bistrot-dArno-239043989636196#_=_', '04 78 24 49 51', '04 78 24 49 51', 'lebistrotdarno@hotmail.com'),
(16, 111, 1, 18, 1, 'Au Pré Fleuri', 'Ouvert très récemment, le pré fleuri assume ses tendances viandesques. La peinture couleur ardoise met en valeur les bibelots bovins déposés çà et là. Une rapide lecture de la carte confirme ce pressentiment : on vient ici pour manger de la viande, et de la bonne : la cuisine se fournit chez Beauvallet, négociant d’Ambérieu-en-Bugey. Stéphane, le patron, met à l’aise tout le monde, pour notre plus grand plaisir !', '2016-01-01', '123 rue de Sèze', '69006', 'validated', 'https://www.facebook.com/restoviandeauprefleuri', NULL, 'https://www.facebook.com/restoviandeauprefleuri', '04 72 75 08 02', '04 72 75 08 02', 'restoviandeauprefleuri@gmail.com'),
(17, 112, 1, 19, 2, 'Momento Sapori e Vini', 'François Heiligenstein, Hervé Leuci et toute son équipe vous proposent de découvrir une cuisine italienne de terroir et de qualité... Alors dégusterez vous des raviolis à la truffe blanche d''Alba, un tiramisu au saumon et sa sauce au topinambour ou alors vous laisserez vous tenter par les antipastis maison ? A moins que vous ne réussissiez à faire votre choix entre la tatin de figues au balsamique et sa quenelle de mascarpone et les profiteroles à la Glace Praliné, Sauce au Chocolat Blanc, mais il reste toujours la promesse d''une assiette pleine de gourmandise !', '2006-01-01', '4 rue Fleurieu', '69002', 'validated', 'https://www.facebook.com/Momento-Sapori-e-Vini-240741932617606/', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d1118704-Reviews-MOMENTO_SAPORI_E_VINI-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/Momento-Sapori-e-Vini-240741932617606/', '04 78 37 00 54', '04 78 37 00 54', 'momento.lyon@bbox.fr'),
(18, 114, 1, 20, 1, 'Alex Restaurant', 'Tons gris et rouge dans une décoration contemporaine, la maison de Marie-Claude et d’Alex Tournadre ne manque pas d’allure. Lyonnais d’adoption et normand d’origine, Alex pratique une belle cuisine de goût. Fidèle aux classiques qu’il revisite avec talent et travaillant des produits de saison rigoureusement sélectionnés, il aime surprendre son monde dans des partitions aux saveurs étonnantes souvent méconnues qui font toujours mouche. Le petit menu à midi en semaine est une véritable aubaine.', '2006-01-01', '44 boulevard des Brotteaux', '69006', 'validated', 'http://www.alexlyon.fr/alex/', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d2092770-Reviews-Alex_Restaurant-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/alexrestaurantlyon/', '04 78 52 30 11', '04 78 52 30 11', 'chez.alex@club-internet.fr'),
(19, 179, 1, 21, 2, 'DUE MAURIZIO', 'Fort de ses titres de Meilleur Restaurant Italien de France, Maurizio Bullano du restaurant DUE situé à Lyon vous fait voyager en Italie à travers l’originalité des plats servis.\r\nMaurizio Bullano est sans doute un des chefs italiens les plus connus de Lyon.  Il propose une cuisine traditionnelle italienne de grande qualité et met à l’honneur poissons et crustacés. Ces plats à la carte sont renouvelés tous les quinze jours, et même si le restaurant ne paye pas mine, tout le monde s’y presse !', '2000-01-01', '8 rue jouffroy', '69009', 'validated', 'http://www.mauriziobullano.com', NULL, 'https://www.facebook.com/RistoranteDueByMaurizio/', '04 72 38 26 43', '06 70 66 06 58', 'maurizio.bullano@yahoo.fr'),
(20, 183, 1, 22, 1, 'Mr Edgar', 'Nouveau venu sur le plateau de la Croix-Rousse, Edgar vous propose une carte de produits frais de saison accompagnée de vins à prix doux, le tout accompagné d''un service irréprochable. On craque pour son joli cadre, avec une déco vintage et industrielle.', '2015-05-19', '4 bis rue de Belfort', '69004', 'validated', 'https://www.facebook.com/restaurant.mr.edgar/', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d8599317-Reviews-Mr_Edgar-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/restaurant.mr.edgar/', '06 65 32 56 14', '04 78 61 73 13', 'mredgar@orange.fr'),
(21, 185, 1, 23, 1, 'L''EPISENS', 'Situé au cœur de la presqu''île de Lyon, l''Episens vous accueille avec une cuisine moderne et raffinée qui éveillera vos sens !', '2015-11-16', '8 rue Palais Grillet', '69002', 'validated', 'http://www.restaurant-lepisens.fr/', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d9696020-Reviews-L_Episens-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/Lepisensrestaurant', '04 30 22 03 34', '04 30 22 03 34', 'restaurantlepisens@gmail.com'),
(22, 360, 1, 26, 4, 'Five', 'FIVE, le restaurant des amoureux du bien manger\r\n\r\nFIVE est un restaurant où le bien manger est érigé en art-de-vivre. C''est pourquoi nous avons pris le parti de proposer des plats toujours gourmands mais en faisant en sorte de les rendre les plus équilibrés et sains possibles en utilisant des produits frais, en proposant uniquement du fait-maison et en supprimant tous les ingrédients que notre organisme a naturellement du mal à digérer, dont le principal est le gluten.\r\nFIVE est donc le premier restaurant-épicerie lyonnais 100 % libre de gluten, et avec des allergènes limités et très clairement identifiés, comme le lactose.\r\n\r\nNotre souhait c’est donc de proposer une nouveau mode d’alimentation, plus sain, plus équilibré et adapté à tous.', '2015-12-25', '69 rue Moncey', '69003', 'validated', 'http://www.restaurantfive.com/', 'https://www.tripadvisor.fr/Restaurant_Review-g187265-d10027485-Reviews-Five-Lyon_Rhone_Rhone_Alpes.html', 'https://www.facebook.com/fiverestaurants/', '0954110576', '0762822664', 'restaurantfive@yahoo.fr');
